    data: |
      SELECT - - 87, 47 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - col2 = col2 / col2 - + col2 * - 25;
  - name: tab0

outputs:
  - name: q12191.out
    data: |
      87	47
      87	47
      87	47
